INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 2, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", 2834, 10118, 20063115, 7, 40, "フリーマーケット会場", 1, 0, "青空の下で謁見", 5118061);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 2, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", 2835, 10118, 20063115, 7, 40, "フリーマーケット会場", 1, 0, "未来の騎空団\nマスコット？", 5118062);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 2, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", 2837, 10118, 20063115, 7, 40, "ランドソル市街地", 1, 0, "お嬢さまからの\n緊急依頼", 5118063);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 2, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", 4108402, 10118, 20063115, 18, 40, "フリーマーケット会場", 1, 0, "黄金色の悩みごと", 5118064);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 2, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", 4107402, 10118, 20063115, 18, 40, "フリーマーケット会場", 1, 0, "白熱！　格闘大会！", 5118065);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 2, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", 9000227, 10118, 20063115, 16, 40, "オーエド町", 1, 1, "祭り太鼓はオーエドの華", 5118066);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 3, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", 2101181, 10118, 20063115, 19, 40, "フリーマーケット会場", 1, 0, "人気者は遅れて\nやってくる", 5118067);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 3, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", 4109402, 10118, 20063115, 18, 40, "ランドソル市街地", 1, 0, "巫女・ミーツ・魔法少女", 5118068);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 3, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", 4305402, 10118, 20063115, 18, 40, "フリーマーケット会場", 1, 0, "ネズ耳は二度なくなる", 5118069);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 3, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", 4101402, 10118, 20063115, 18, 40, "ランドソル市街地", 1, 0, "この出会いにカンパイ！", 5118070);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 3, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", 4106402, 10118, 20063115, 18, 40, "ランドソル市街地", 1, 0, "陰陽アンサンブル", 5118071);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (8, 91002, 3, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", 2836, 10118, 20063115, 7, 40, "フリーマーケット会場", 1, 1, "運試し十番勝負！", 5118072);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 0, 1, 0, "オープニング", 0, 10118, 20063115, 0, 0, 0, 0, 0, "彼女たちの新たな日常", 5118600);
